!function(){"use strict";$.getJSON(window.apiUrl+"/restaurants/following/"+window.username+"/",function(e){var n=$(".template").children().first().clone();$.each(e,function(e,i){var t=n.clone();t.find(".name").text(i.name),t.find(".price-range .low").text(i.price_low),t.find(".price-range .high").text(i.price_high),t.find(".address").text(i.location_name),t.find(".photo img").attr("src","images/"+i.photo),$(".main-div").append(t)})})}();